-- ----------------------------
--  Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `meno` varchar(15) COLLATE utf8_bin NOT NULL,
  `priezvisko` varchar(30) COLLATE utf8_bin NOT NULL,
  `email` varchar(30) COLLATE utf8_bin NOT NULL,
  `username` varchar(45) COLLATE utf8_bin DEFAULT NULL,
  `password` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `role_user` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Set 0 or 1 for user rights',
  `role_manager` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Set 0 or 1 for manager rights',
  `role_admin` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Set 0 or 1 for admin rights',
  `lastLogin` datetime DEFAULT NULL,
  `blocked` int(1) NOT NULL,
  `id_katedra` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=682 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

